import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import { Nav, Navbar, Container, Row, Col } from "react-bootstrap";
import CreateBlog from "./Components/create-blog.component";
import EditBlog from "./Components/edit-blog.component";
import BlogList from "./Components/blog-list.component";
import "./App.css";

const App = () => {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <Navbar bg="dark" variant="dark">
            <Container>
              <Navbar.Brand>
                <Link to={"/create-blog"} className="nav-link">
                  React MERN Stack App
                </Link>
              </Navbar.Brand>

              <Nav className="justify-content-end">
                <Nav>
                  <Link to={"/create-blog"} className="nav-link">
                    Create Collection
                  </Link>
                </Nav>

                <Nav>
                  <Link to={"/blog-list"} className="nav-link">
                    Collection List
                  </Link>
                </Nav>
              </Nav>
            </Container>
          </Navbar>
        </header>

        <Container>
          <Row>
            <Col md={12}>
              <div className="wrapper">
                <Routes>
                  <Route exact path="/" element={<CreateBlog />} />
                  <Route path="/create-blog" element={<CreateBlog />} />
                  <Route path="/edit-blog/:id" element={<EditBlog />} />
                  <Route path="/blog-list" element={<BlogList />} />
                </Routes>
              </div>
            </Col>
          </Row>
        </Container>
      </div>
    </Router>
  );
};

export default App;
